(2, 'مطور الواجهات الأمامية', 'Front-end developer', 'لقد أحدث العصر الرقمي تحولًا في مشهد الموارد البشرية، حيث قدم فرصًا وتحديات جديدة لمحترفي الموارد البشرية. إن تبني الابتكارات التكنولوجية يمكن أن يحدث ثورة في عمليات الموارد البشرية، ويعزز الكفاءة، ويمكّن من اتخاذ القرارات القائمة على البيانات. لقد أحدث العصر الرقمي تحولًا في مشهد الموارد البشرية، حيث قدم فرصًا وتحديات جديدة لمحترفي الموارد البشرية. إن تبني الابتكارات التكنولوجية يمكن أن يحدث ثورة في عمليات الموارد البشرية، ويعزز الكفاءة، ويمكّن من اتخاذ القرارات القائمة على البيانات.', 'The digital age has transformed the HR landscape, presenting new opportunities and challenges for HR professionals. Embracing technological innovations can revolutionize HR processes, enhance efficiency, and enable data-driven decision-making. The digital age has transformed the HR landscape, presenting new opportunities and challenges for HR professionals. Embracing technological innovations can revolutionize HR processes, enhance efficiency, and enable data-driven decision-making.', '<ul>\r\n	<li>إتقان تقنيات الواجهة الأمامية HTML وCSS وأطر عمل JavaScript مثل React أو Angula</li>\r\n	<li>إتقان تقنيات الواجهة الأمامية BOOTSTRAP وأطر عمل JAVA مثل React أو Angula</li>\r\n	<li>الكفاءة في تقنيات الواجهة الأمامية وأطر عمل JQUERY مثل React أو Angula</li>\r\n</ul>\r\n\r\n<div class=\"eJOY__extension_root_class\" id=\"eJOY__extension_root\" style=\"all: unset;\">&nbsp;</div>', '<ul>\r\n	<li>Proficiency in front-end technologies HTML, CSS, JavaScript frameworks like React or Angula</li>\r\n	<li>Proficiency in front-end technologies BOOTSTRAP, JAVA frameworks like React or Angula</li>\r\n	<li>Proficiency in front-end technologies JQUERY frameworks like React or Angula</li>\r\n</ul>\r\n\r\n<div class=\"eJOY__extension_root_class\" id=\"eJOY__extension_root\" style=\"all: unset;\">&nbsp;</div>', 'دوام كامل', 'Full time', 'من المكتب', 'On Office', '30,000 دولار', '30,000 dollar', '3+ سنوات', '3+ years', 'منوف, المنوفية', 'Mounof, Moufia', 1,