(3, 'مطور الواجهات الخلفية', 'Back-end developer', 'لقد أحدث العصر الرقمي تحولًا في مشهد صناعة البرمجيات، حيث قدم فرصًا وتحديات جديدة لمحترفي الموارد البشرية. إن تبني الابتكارات التكنولوجية يمكن أن يحدث ثورة في عمليات الموارد البشرية، ويعزز الكفاءة، ويمكّن من اتخاذ القرارات القائمة على البيانات. لقد أحدث العصر الرقمي تحولًا في مشهد الموارد البشرية، حيث قدم فرصًا وتحديات جديدة لمحترفي الموارد البشرية. إن تبني الابتكارات التكنولوجية يمكن أن يحدث ثورة في عمليات الموارد البشرية، ويعزز الكفاءة، ويمكّن من اتخاذ القرارات القائمة على البيانات.', 'The digital age has transformed the programing filed, presenting new opportunities and challenges for HR professionals. Embracing technological innovations can revolutionize HR processes, enhance efficiency, and enable data-driven decision-making. The digital age has transformed the HR landscape, presenting new opportunities and challenges for HR professionals. Embracing technological innovations can revolutionize HR processes, enhance efficiency, and enable data-driven decision-making.', '<ul>\r\n	<li>تطوير وصيانة المواقع والتطبيقات</li>\r\n	<li>ربط قاعدة البيانات</li>\r\n	<li>فريق المساعدة</li>\r\n</ul>', '<ul>\r\n	<li>develop and maintain websites and applications</li>\r\n	<li>connect database</li>\r\n	<li>Help team</li>\r\n</ul>', 'دوام جزئي', 'Part Time', 'عن بعد', 'Remotly', '50,000 دولار', '50,000 dollar', '10+ سنوات', '10+ years', 'الغلمين الجديدة, مصر', 'Alamin, Egypt', 1, '2024-10-02 13:04:22', '2024-10-02 14:47:30'),
