(5, 'ترك الوحدة النمطية', 'Leave module', 'تعامل مع طلبات إجازات الموظفين وأرصدتها بكفاءة من خلال قواعد وسير عمل وإحصائيات سهلة الاستخدام وقابلة للتخصيص.', 'Handle employee leave requests and balances efficiently with user-friendly and customizable rules, workflows, and statistics.', 'يمكنك إنشاء أنواع مختلفة من الإجازات، وإعداد قواعد الإجازات ومهام سير العمل، ومراقبة اتجاهات الإجازات وإحصائياتها.', 'You can create different leave types, set up leave rules and workflows, and monitor leave trends and statistics.', '/uploads/Modules/1727268452_3965.webp', 1, '2024-09-25 11:56:14', '2024-09-25 12:47:32'),
(6, 'وحدة الرواتب', 'Payroll module', 'قم بحساب ومعالجة رواتب الموظفين بدقة من خلال نظامنا القوي والموثوق.', 'Calculate and process employee salaries accurately with our powerful and reliable system.', 'يمكنك تكوين مكونات كشوف المرتبات المختلفة، والتكامل مع وحدات الموارد البشرية الأخرى، والامتثال للوائح القانونية.', 'You can configure different payroll components, integrate with other HR modules, and comply with legal regulations.', '/uploads/Modules/1727266060_9710.webp', 1, '2024-09-25 12:07:40', '2024-09-25 12:14:24'),
