(50, 'privacyTitle_ar', 'نشكرك على اختيارك أن تكون جزءًا من مجتمعنا في CannyTechs (\"الشركة\"، أو \"نحن\"، أو \"خاصتنا\"). نحن ملتزمون بحماية معلوماتك الشخصية وحقك في الخصوصية. إذا كان لديك أي أسئلة أو مخاوف بشأن إشعارنا، أو ممارساتنا فيما يتعلق بمعلوماتك الشخصية، يرجى الاتصال بنا على info@dawmt.com. نحن نأخذ خصوصيتك على محمل الجد.', 'privacy', 1, NULL, '2024-09-26 09:45:13'),
(51, 'privacyTitle_en', 'Thank you for choosing to be part of our community at CannyTechs (“Company”, “we”, “us”, or “our”). We are committed to protecting your personal information and your right to privacy. If you have any questions or concerns about our notice, or our practices with regards to your personal information, please contact us at info@dawmt.com. We take your privacy very seriously.', 'privacy', 1, NULL, '2024-09-26 09:45:13'),
(52, 'privacy_ar', '<p><strong>ملخص النقاط الرئيسية</strong></p>\r\n\r\n<p>لوريم إيبسوم هو نص افتراضي يستخدم في صناعة الطباعة والنشر. تتعلق هذه الفقرة بالأمور الهامة مثل استمرارية العمل والأمانة والحرص على النتائج. كما تتطرق إلى مواضيع مثل كيفية التعامل مع الأخطاء أو التحديات. النص يسلط الضوء على مسؤوليات معينة مثل السعي إلى تحقيق أفضل النتائج وتجنب التأثيرات السلبية. كما يناقش الالتزام بالجودة والكفاءة في الأداء، بالإضافة إلى التركيز على السمعة المهنية واحترام المسؤوليات المختلفة في مجالات العمل.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ملخص النقاط الرئيسية</strong></p>\r\n\r\n<p>لوريم إيبسوم هو نص افتراضي يستخدم في صناعة الطباعة والنشر. تتعلق هذه الفقرة بالأمور الهامة مثل استمرارية العمل والأمانة والحرص على النتائج. كما تتطرق إلى مواضيع مثل كيفية التعامل مع الأخطاء أو التحديات. النص يسلط الضوء على مسؤوليات معينة مثل السعي إلى تحقيق أفضل النتائج وتجنب التأثيرات السلبية. كما يناقش الالتزام بالجودة والكفاءة في الأداء، بالإضافة إلى التركيز على السمعة المهنية واحترام المسؤوليات المختلفة في مجالات العمل.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ملخص النقاط الرئيسية</strong></p>\r\n\r\n<p>لوريم إيبسوم هو نص افتراضي يستخدم في صناعة الطباعة والنشر. تتعلق هذه الفقرة بالأمور الهامة مثل استمرارية العمل والأمانة والحرص على النتائج. كما تتطرق إلى مواضيع مثل كيفية التعامل مع الأخطاء أو التحديات. النص يسلط الضوء على مسؤوليات معينة مثل السعي إلى تحقيق أفضل النتائج وتجنب التأثيرات السلبية. كما يناقش الالتزام بالجودة والكفاءة في الأداء، بالإضافة إلى التركيز على السمعة المهنية واحترام المسؤوليات المختلفة في مجالات العمل.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ملخص النقاط الرئيسية</strong></p>\r\n\r\n<p>لوريم إيبسوم هو نص افتراضي يستخدم في صناعة الطباعة والنشر. تتعلق هذه الفقرة بالأمور الهامة مثل استمرارية العمل والأمانة والحرص على النتائج. كما تتطرق إلى مواضيع مثل كيفية التعامل مع الأخطاء أو التحديات. النص يسلط الضوء على مسؤوليات معينة مثل السعي إلى تحقيق أفضل النتائج وتجنب التأثيرات السلبية. كما يناقش الالتزام بالجودة والكفاءة في الأداء، بالإضافة إلى التركيز على السمعة المهن