(66, 'homeTitle_ar', 'اكتشف الفرص التي تتناسب مع شغفك وموهبتك. وظيفة أحلامك في انتظارك!', 'home', 1, NULL, '2024-09-24 15:08:04'),
(67, 'homeTitle_en', 'Discover Opportunities That Match Your Passion and Talent. Your Dream Job Awaits!', 'home', 1, NULL, '2024-09-24 15:08:04'),
(68, 'homeDesc_ar', 'اكتشف مستقبل إدارة الموارد البشرية اليوم مع النظام الأكثر شمولاً وتطوراً في المنطقة. دومت هنا لمساعدتك على أتمتة جميع عمليات الموارد البشرية واكتشاف مستوى جديد من الإنتاجية وتحقيق التميز.', 'home', 1, NULL, '2024-09-24 15:08:04'),
(70, 'homeDesc_en', 'Experience the future of Human Resource Management today with the most comprehensive and advanced system in the region. Dawmt is here to help you automate all HR processes and discover a new level of productivity and achieve differentiation.', 'home', 1, NULL, '2024-09-24 15:08:04'),
