(79, 'joinUsTitle_en', 'Dedicated to Give You The Best Services', 'home', 1, NULL, '2024-09-24 15:08:04'),
(80, 'joinUsDesc_ar', 'نحن نقدم خدمات تجميل الأنف والوجه من الدرجة الأولى بقيادة أخصائي تجميل الأنف الخبير. رعايتنا الشخصية وتقنياتنا المتقدمة والتزامنا بإرضاء المرضى تضمن لك الحصول على أفضل النتائج الممكنة. ثق بنا لتعزيز جمالك الطبيعي بدقة وعناية.', 'home', 1, NULL, '2024-09-24 15:08:04'),
(81, 'joinUsDesc_en', 'We offer top-notch rhinoplasty and facial aesthetic services led by an expert rhinologist. Our personalized care, advanced techniques, and commitment to patient satisfaction ensure you receive the best possible results. Trust us to enhance your natural beauty with precision and care.', 'home', 1, NULL, '2024-09-24 15:08:04'),
(90, 'ess_application_title_ar', 'تم تصميم التطبيق الأكثر شمولاً، والذي يقدم مجموعة لا مثيل لها تضم ​​أكثر من 100 وظيفة، لتمكين الموظفين من خلال وضع جميع الأدوات والموارد الضرورية في متناول أيديهم مباشرة، مما يضمن حصولهم على كل ما يحتاجون إليه للتفوق في أدوارهم وتبسيط مهامهم اليومية بسهولة.', 'ess_application', 1, NULL, '2024-09-28 10:08:11'),
(91, 'ess_application_title_en', 'The most comprehensive application, offering an unparalleled suite of over 100 functions, is designed to empower employees by placing all necessary tools and resources directly at their fingertips, ensuring they have everything they need to excel in their roles and streamline their daily tasks with ease.', 'ess_application', 1, NULL, '2024-09-28 10:08:11'),
