(95, 'solution_value_desc_en', 'Dawmt is the simplest HR management solution which can fit any organization type', 'values', 1, NULL, '2024-09-29 10:58:17'),
(96, 'why_need_us_desc_ar', 'لأننا هنا لمساعدتك على أتمتة جميع عمليات الموارد البشرية واكتشاف مستوى جديد من الإنتاجية وتحقيق التميز.', 'values', 1, NULL, '2024-09-29 10:58:17'),
(97, 'why_need_us_desc_en', 'Because we are here to help you automate all HR processes and discover a new level of productivity and achieve differentiation.', 'values', 1, NULL, '2024-09-29 10:58:17'),
(98, 'vid_title_ar', 'أهمية قيادة الموارد البشرية للنجاح في مكان العمل', 'videos', 1, NULL, '2024-09-29 14:34:25'),
(99, 'vid_title_en', 'The Importance of HR Driving Success in the Workplace', 'videos', 1, NULL, '2024-09-29 14:34:25'),
(100, 'vid_desc_ar', 'في بيئة الأعمال التنافسية اليوم، تحتاج الشركات إلى أكثر من مجرد منتج أو خدمة رائعة لتزدهر. إن العمود الفقري لأي منظمة ناجحة يكمن في مواردها البشرية، وهنا تلعب أنظمة إدارة الموارد البشرية دوراً حاسماً.', 'videos', 1, NULL, '2024-09-29 14:34:25'),
(101, 'vid_desc_en', 'In today\'s competitive business landscape, companies need more than just a great product or service to thrive. The backbone of any successful organization lies in its human resources, and this is where HR management systems play a crucial role.', 'videos', 1, NULL, '2024-09-29 14:34:25'),
(102, 'vid_image', '/uploads/Settings/1727619070_1957.webp', 'videos', 1, NULL, '2024-09-29 14:11:10'),
