(105, 'clientStoriesTitle_en', 'Dedicated to Give You The Best Services', 'clientStories', 1, NULL, '2024-10-02 08:48:53'),
(106, 'clientStoriesDesc_ar', 'نحن نقدم خدمات تجميل الأنف والوجه من الدرجة الأولى بقيادة أخصائي تجميل الأنف الخبير. رعايتنا الشخصية وتقنياتنا المتقدمة والتزامنا بإرضاء المرضى تضمن لك الحصول على أفضل النتائج الممكنة. ثق بنا لتعزيز جمالك الطبيعي بدقة وعناية.', 'clientStories', 1, NULL, '2024-10-02 08:48:53'),
(107, 'clientStoriesDesc_en', 'We offer top-notch rhinoplasty and facial aesthetic services led by an expert rhinologist. Our personalized care, advanced techniques, and commitment to patient satisfaction ensure you receive the best possible results. Trust us to enhance your natural beauty with precision and care.', 'clientStories', 1, NULL, '2024-10-02 08:48:53'),
(108, 'clientStoriesSubTitle_ar', 'انضم إلى مئات الشركات الرائدة التي اختارت دوام للحلول لتحقيق النجاح والازدهار', 'clientStories', 1, NULL, '2024-10-02 08:48:53'),
(109, 'clientStoriesSubTitle_en', 'Join the hundreds of leading companies that have chosen Dawmt Solution to succeed and thrive', 'clientStories', 1, NULL, '2024-10-02 08:48:53'),
